import React from "react";

const Button = ({ children, className = "", type = "button", onClick }) => {
  return (
    <button
      type={type}
      onClick={onClick}
      className={`w-full ةلا- bg-main1 text-light py-2 rounded-xl text-lg hover:bg-opacity-90 transition ${className}`}
    >
      {children}
    </button>
  );
};

export default Button;
